import{_ as t,c as a,o,a4 as r}from"./chunks/framework.Bdh9hNeQ.js";const s="/assets/ascreenshot_7e67ecefd84e4e66863986699e26b9b0_text_export.BbNVR5IG.jpeg",i="/assets/ascreenshot_fdcc3ade5e5941d19163c78f0f8833b2_text_export.CiszajDr.jpeg",n="/assets/ascreenshot_838afbddcdcc488f96b6a2908ee6eab6_text_export.fYkAWPJg.jpeg",h="/assets/ascreenshot_2b182b3129654575828b87e7153b5772_text_export.y2KZUb8T.jpeg",l="/assets/File_755e2ac773c04567ab5ec3493396b3d6_text_export.DC9vQhyQ.jpeg",c="/assets/File_f947262e963545218f617b68e35d5ca3_text_export.DrFQY-lq.jpeg",p="/assets/File_f8c6dea02fe24a84b43a96e110dd2f11_text_export.C4J6fgyF.jpeg",d="/assets/File_16d05e3ad2eb4698832a160d9b7ca170_text_export.BzIQMj_D.jpeg",x=JSON.parse('{"title":"Introduction to the CIF Dashboard","description":"","frontmatter":{},"headers":[],"relativePath":"tutorials/introduction_to_cif_tutorial.md","filePath":"tutorials/introduction_to_cif_tutorial.md"}'),b={name:"tutorials/introduction_to_cif_tutorial.md"};function u(f,e,_,m,g,v){return o(),a("div",null,[...e[0]||(e[0]=[r('<h1 id="introduction-to-the-cif-dashboard" tabindex="-1">Introduction to the CIF Dashboard <a class="header-anchor" href="#introduction-to-the-cif-dashboard" aria-label="Permalink to &quot;Introduction to the CIF Dashboard&quot;">â€‹</a></h1><p>1. Navigate to <a href="https://cif.eox.at/" target="_blank" rel="noreferrer">https://cif.eox.at/</a></p><p>2. The CIF Home Page provides background information about the Cerulean Information Factory project. The menu at the top right provides links back to the Home Page, to the CIF Dashboard, to CIF Stories, to the CIF Story Editor, and to the Help Pages. Each of these options is described in separate tutorials accessible from the Help Pages. We will start with the CIF Dashboard. Click &quot;Dashboard&quot;</p><p><img src="'+s+'" alt=""></p><p>3. The CIF Dashboard begins with a map. The map can be populated with information chosen from the Select Indicator menu at the top left. Click &quot;Select Indicator&quot;</p><p><img src="'+i+'" alt=""></p><p>4. This menu provides access to a wide range of Capabilities (algorithms that process data to derive information) and data variables.</p><p>The options can be filtered using a search function or the Theme Filter. In this example, the search term &quot;sea ice&quot; and the theme &quot;Shipping&quot; have been used as a filters to reduce the number of capabilities and data variables offered.</p><p>Next, the &quot;Sea Ice Area Fraction&quot; data variable will be used to illustrate components of the dashboard. Click &quot;Sea Ice Area Fraction&quot;.</p><p><img src="'+n+'" alt=""></p><p>5. This is an overview of a typical Dashboard data variable visualisation. The panel at the left provides the legend and date of the variable currently being viewed. It also provides access to overlay and base data layers. The panel at the upper right contains the metadata for the variable. The panel at the lower right is the user interface to manipulate the variable or capability. The box at the centre bottom is an expandable calendar that shows when data is available. The boxes at the lower left show the coordinates of the cursor position and the scale of the current zoom level. Each of the panels will now be looked at in more detail.</p><p><img src="'+h+'" alt=""></p><p>6. The Left Panel shows the Overlay Layers, Data Layers, and Base Layers.</p><p>In the this example, the &quot;Wind Energy Areas&quot; of the Overlay Layers has been selected and is visable as the red polygons near Nova Scotia at the bottom centre of the map.</p><p>The Data Layers section of the panel shows the current date selected, the legend for the variable, and the current opacity of the layer. The date and opacity can be manipulated using the slider bars.</p><p><img src="'+l+'" alt=""></p><p>7. The Top Right Panel shows the metadata for the selected variable or capacity. The information varies by variable, but typically consists of the variable title, the applicable themes (highlighted under the title), the sensor used, the agency providing the data or algorithm, the frequency of acquistions, the geospatial resolution, the time extent of the data available, a description, and a link or DOI to further information.</p><p><img src="'+c+'" alt=""></p><p>8. The Bottom Right Panel contains the user interface for data or capability that can be manipulated by the user. There are separate tutorials for each of these.</p><p><img src="'+p+'" alt=""></p><p>9. The Bottom Panel contains a dropdown calendar that shows when data is available (in this case, shown as green dots) and allows data from those dates to be selected.</p><p><img src="'+d+'" alt=""></p><p>10. Return to the Dashboard</p><p>Return to the Tutorial Contents</p><p>Continue to the next Tutorial</p>',25)])])}const y=t(b,[["render",u]]);export{x as __pageData,y as default};
